class DetailHeroCarousel extends Component {

    componentDidMount()  {
        const firstPic= this.props.pic[0]
    }


    render() {
        console.log("Carousel", this.props.pic)
        return (
            <Carousel axis="vertical" useKeyboardArrows autoPlay infiniteLoop>
                <div className="carouselHeight">
                    <img src={this.firstPic} width="350px" height="150px" />
                        <p className="legend">
                        Legend 
                        </p>
                </div>
                <div>
                    <img src="http://placehold.it/350x150" />

                </div>
                <div>
                    <img src="http://placehold.it/350x150" />

                </div>
            </Carousel>
        );
    }
}

